import React from "react";

function Header() {
  return (
    <header>
      <nav>
        <a href="./main.js/.main">HOME</a>
        <a href="./main.js/.about-me">ABOUT ME</a>
        <a href=".projects">PROJECTS</a>
        <a href=".services">SERVICES</a>
        <a href=".contact-me">CONTACT ME</a>
      </nav>
    </header>
  );
}

export default Header;
